import React, {Component, useEffect, useState} from 'react';
import './ComicDisplay.css';
import {connect} from 'react-redux';
import axios from "axios";

class ComicDisplay extends Component {
    render() {
        const number = this.props.number;
        const url = this.props.url;

        let data = {
            number: '',
            current: {
                title: 'title',
                safeTitle: 'safeTitle',
                img: 'https://imgs.xkcd.com/comics/dimensional_chess.png',
                alt: 'alt',
                num: '69',
                day: '01',
                month: 'January',
                year: '2001'
            },
            isLoading: false
        }


       const axios = require('axios');

       async function makeGetRequest(url) {
           let res = await axios.get(url);
           let data = res.data;
           console.log(data);
       }

        return (
            <div>
                <h1>{number}  {url} {makeGetRequest(this.props.url)}</h1>
            </div>
        )
    }
}

const mapStateToProps = state => {
    return {
        number: state.number,
        url: state.url
    };
};

export default connect(mapStateToProps, null)(ComicDisplay);
